    false,nt"url": null,nt"notes": "This dataset represents the extent and
    spatial distribution of irrigated agricultural lands in the Upper Colorado River
    Basin for 2007-10. The boundaries in this dataset were modified from data developed
    by state and local agencies in Colorado, New Mexico, Utah, and Wyoming. The data
    contain information about the irrigation method used to water the fields and an
    estimate of the irrigation status of the field for the summer growing seasons between
    2007 and 2010. Irrigation method was determined from examination of 1-meter aerial
    imagery. Irrigation status was estimated from Landsat 5 Thematic Mapper satellite
    imagery and land cover classification methods.",nt"license_title": null,nt"extras":
